using UnityEngine;
using UnityEngine.UI;
using System.Collections;
using System.Collections.Generic;

public class InputPanel : MonoBehaviour {

    public string precipRateTag = "PrecRateValue";
    public string precipTypeTag = "PrecTypeValue";
    public string tempTag = "TempValue";
    public string bpTag = "BaroPressValue";
    public string lwTag = "LWValue";
    public string solarTag = "SolarValue";
    public string netradTag = "NetRadValue";

    private Text temp;
    private Text bp;
    private Text precipRate;
    private Text precipType;
    private Text lw;
    private Text solar;
    private Text netrad;

    private Dictionary<int, float> m_pp;
    private Dictionary<int, float> p_snow;
    private Dictionary<int, float> T_a;
    private Dictionary<int, float> e_a;
    private Dictionary<int, float> I_lw;
    private Dictionary<int, float> S_n;

    private GameObject slider;
    private SliderUpdate sliderUpdateScript;

	// Use this for initialization
    void Start()
    {
        slider = GameObject.FindWithTag("TimeSlider");
        sliderUpdateScript = (SliderUpdate)slider.GetComponent<SliderUpdate>();

        temp = GameObject.FindWithTag(tempTag).GetComponent<Text>();
        bp = GameObject.FindWithTag(bpTag).GetComponent<Text>();
        precipRate = GameObject.FindWithTag(precipRateTag).GetComponent<Text>();
        precipType = GameObject.FindWithTag(precipTypeTag).GetComponent<Text>();
        lw = GameObject.FindWithTag(lwTag).GetComponent<Text>();
        solar = GameObject.FindWithTag(solarTag).GetComponent<Text>();
        netrad = GameObject.FindWithTag(netradTag).GetComponent<Text>();

        load_m_pp();
        load_p_snow();
        load_T_a();
        load_e_a();
        load_I_lw();
        load_S_n();
	}

    public float valueAtStep(string key, int step)
    {
        try
        { 
            if (key == "m_pp")
            {
                if (m_pp.ContainsKey(step))
                    return m_pp[step];
            }
            else if (key == "e_a")
            {
                if (e_a.ContainsKey(step))
                    return e_a[step];
            }
            else if (key == "T_a")
            {
                if (T_a.ContainsKey(step))
                    return T_a[step];
            }
            else if (key == "I_lw")
            {
                if (I_lw.ContainsKey(step))
                    return I_lw[step];
            }
            else if (key == "S_n")
            {
                if (S_n.ContainsKey(step))
                    return S_n[step];
            }
            return 0f;
        }
        catch { return 0f; }
    }
	
	void Update () 
    {
        int step = (int)sliderUpdateScript.SimStepProperty;
        if (m_pp.ContainsKey(step))
            precipRate.text = m_pp[step].ToString("0.00");
        else
            precipRate.text = "0.00";

        if (p_snow.ContainsKey(step))
        {
            if (p_snow[step] == 1f)
                precipType.text = "Snow";
            else if (p_snow[step] == 0f)
                precipType.text = "Rain";
            else
                precipType.text = "Mixed";
        }
        else
            precipType.text = "-";

        if (T_a.ContainsKey(step))
            temp.text = T_a[step].ToString("0.00");
        else
            temp.text = "-";

        if (e_a.ContainsKey(step))
            bp.text = e_a[step].ToString("F0");
        else
            bp.text = "-";

        if (I_lw.ContainsKey(step))
            lw.text = I_lw[step].ToString("0.0");
        else
            lw.text = "0.0";

        if (S_n.ContainsKey(step))
        {
            solar.text = S_n[step].ToString("0.0");

            if (I_lw.ContainsKey(step))
                netrad.text = (I_lw[step] + S_n[step]).ToString("0.0");
            else
                netrad.text = "0.0";
        }
        else
        { 
            solar.text = "0.0";
            netrad.text = "0.0";
        }
	}

